      /**
      * AES JSON formatter for CryptoJS
      * @link https://github.com/brainfoolong/cryptojs-aes-php
      * @version 2.1.1
      */

      var CryptoJSAesEnc = {
        /**
        * Encrypt any value
        * @param {*} value
        * @param {string} password
        * @return {string}
        */
        'encrypt': function(binary, password) {
          return CryptoJS.AES.encrypt(binary, password, {
            format: CryptoJSAesEnc
          }).toString()
        },
        /**
        * Decrypt a previously encrypted value
        * @param {string} jsonStr
        * @param {string} password
        * @return {*}
        */
        'decrypt': function(yencrypted, password) {
          return CryptoJS.AES.decrypt(yencrypted, password, {
            format: CryptoJSAesEnc
          });
        },
        /**
        * Stringify cryptojs data
        * @param {Object} cipherParams
        * @return {string}
        */
        'stringify': function(cipherParams) {
          var j = {}
          if (cipherParams.iv) j.iv = cipherParams.iv.toString()
          if (cipherParams.salt) j.salt = cipherParams.salt.toString()
          return JSON.stringify(j).replace(/\s/g, '') + "\n" + cipherParams.ciphertext.toString((data) => z85.encode(w2a(data)));
        },
        /**
        * Parse cryptojs data
        * @param {string} jsonStr
        * @return {*}
        */
        'parse': function(payload) {
          var pieces = payload.split(/\n(.*)/s);
          var j = JSON.parse(pieces[0]);
          var cipherParams = CryptoJS.lib.CipherParams.create({
            ciphertext: a2w(z85.decode(pieces[1]))
          });
          if (j.iv) cipherParams.iv = CryptoJS.enc.Hex.parse(j.iv)
          if (j.salt) cipherParams.salt = CryptoJS.enc.Hex.parse(j.salt)
          return cipherParams
        }
      }

      function concatUint8Arrays(...as) {
        const size = as.reduce((size, a) => size + a.length, 0);
        const c = new Uint8Array(size);
        let i = 0;
        for (const a of as) {
          c.set(a, i);
          i += a.length;
        }
        return c;
      }

      function isJsonString(str) {
        try {
          JSON.parse(str);
        } catch (e) {
          return false;
        }
        return true;
      }

      function isencrypted(str) {
        return str.charAt(0) === "{" && str.charAt(str.length - 1) === "}";
      }

      let medcrypt = {
    	loadedCache: {},
        transfers: {
          loaded: 0,
          size: 0,
        },
        displayProgress: function() {
          if ($("#progress").length === 0) {
            $("body").append($("<div><b></b><i></i></div>").attr("id", "progress"));
          }
          var progress = Math.round(medcrypt.transfers.loaded/medcrypt.transfers.size*100);
          $("#progress").width(progress+'%').delay(800);
          if (progress >= 100) {
            $("#progress").fadeOut(1000, function() {
              $(this).remove();
            });
          }
        },
        finishProgress: function() {
          medcrypt.transfers.loaded = 0;
          medcrypt.transfers.size = 0;
          $("#progress").fadeOut(1000, function() {
            $(this).remove();
          });
        },
        extToMimes: {
          'jpg': 'image/jpeg',
          'jpeg': 'image/jpeg',
          'gif': 'image/gif',
          'png': 'image/png',
          'mp4': 'video/mp4',
          'webm': 'video/webm',
          'js': 'application/javascript',
          'txt': 'text/plain',
        },
        getMime: function(resource) {
          var re = /(?:\.([^.]+))?$/;
          var ext = re.exec(resource)[1];
          if (medcrypt.extToMimes.hasOwnProperty(ext)) {
            return medcrypt.extToMimes[ext];
          }
          return 'application/octect-stream';
        },
        isImage: function(resource) {
          var re = /(?:\.([^.]+))?$/;
          var ext = re.exec(resource)[1];
          return ['jpg', 'jpeg', 'png'].includes(ext);
        },
        isVideo: function(resource) {
          var re = /(?:\.([^.]+))?$/;
          var ext = re.exec(resource)[1];
          return ['mp4', 'webm', 'gif'].includes(ext);
        },
        requestQueue: [],
        dirCache: {},
        startQueue: async () => {
          var chunkSize = 8;
          while (medcrypt.requestQueue.length) {
            await new Promise(r => setTimeout(r, Math.floor(Math.random() * 400) + 100));
            if (medcrypt.requestQueue.length >= chunkSize) {
                await Promise.allSettled(Array(chunkSize).fill().map((v,i)=>medcrypt.requestQueue.shift()()));
            } else {
                const item = medcrypt.requestQueue.shift()
                await item()
            }
          }
        },
        flushQueue: () => {
          medcrypt.requestQueue = [];
        },
        processingQueue: false,
        maxTries: 3,
        getSrc: function(resource, action = () => {}, currentTries = 0) {
            medcrypt.requestQueue.push(async () => {
                return new Promise((resolve, reject) => {
                	if (medcrypt.loadedCache[resource]) {
                		return resolve(medcrypt.loadedCache[resource]);
                	}

                    fetch(resource, {
                            headers: {
                            'content-type': 'text/plain;charset=UTF-8',
                            'range': 'bytes=0-10'
                            },
                        })
                        .then(response => {
                            return response.text();
                        })
                        .then(start => {
                            if (start[0] === '{') {
                            // it looks like a json file and is likely encrypted
                            fetch(resource)
                                .then(response => new Promise((pass, deny) => {
                                  var contentLength = response.headers.get('content-length');
                                  medcrypt.transfers.size = parseInt(contentLength, 10);
                                  medcrypt.transfers.loaded = 0;
                                let fetchReader = response.body.getReader(),
                                    decoder = new TextDecoder(),
                                    salts = "",
                                    currentLineData = "",
                                    blobs = [];
                                return fetchReader.read()
                                    .then(async function processRead({
                                    done,
                                    value
                                    }) {
                                    if (done === true) {
                                        medcrypt.finishProgress();
                                        let mergedArray = concatUint8Arrays(...blobs);
                                        var mime = response.headers.get("Content-Type");
                                        if(resource.split('.').pop().includes('-gz')) {
                                        mergedArray = pako.inflate(mergedArray);
                                        mime = medcrypt.getMime(resource.replace('-gz', ''));
                                        }
										var blobUrl = window.URL.createObjectURL(
                                            new Blob(
                                            [mergedArray], {
                                                type: mime
                                            }
                                            )
                                        );
								        medcrypt.loadedCache[resource] = blobUrl;
                                        return pass(blobUrl);
                                    }

                                    for (const line of decoder.decode(
                            value,
                            { stream: !done }
                        ).split("\n")) {
                          if(isJsonString(line)) {
                            salts = line;
                          }else{
                            if(!isencrypted(currentLineData.trim())) {
                              currentLineData += line;
                            }
                            if (isencrypted(currentLineData.trim())) {
                              var j = JSON.parse(salts);
                              blobs.push(w2a(CryptoJSAesEnc.decrypt(salts + "\n" + currentLineData.substring(1, currentLineData.length - 1), passphrase)));
                              currentLineData = "";
                            }
                          }
                        };

                                    medcrypt.transfers.loaded += value.byteLength;
                                    medcrypt.displayProgress();
                                    return fetchReader.read().then(processRead).catch(deny);
                                    }).catch(deny);
                                }))
                                .then((blobUrl) => {
                                resolve(blobUrl);
                                }).catch(reject);
                            } else {
                            resolve(resource);
                            }
                        }).catch(reject);
                }).then((success) => {
                    return Promise.resolve(success);
                }).then(action).catch((err) => {
                    medcrypt.finishProgress();
	                if (currentTries < medcrypt.maxTries) {
	                	console.log("Retrying Decryption");
	                	medcrypt.getSrc(resource, action, currentTries + 1);
	                } else {
                        console.error(err);
	                	console.error("failed to decrypt");
	                	action("")
	                }
                });
            });
            if (!medcrypt.processingQueue) medcrypt.processingQueue = medcrypt.startQueue()
            return medcrypt.processingQueue.finally(() => {
                medcrypt.processingQueue = undefined
            });
        }
      };

      function setWithExpiry(key, value, ttl) {
        const now = new Date()

        // `item` is an object which contains the original value
        // as well as the time when it's supposed to expire
        const item = {
          value: value,
          expiry: now.getTime() + ttl,
        }
        localStorage.setItem(key, JSON.stringify(item))
      }

      function getWithExpiry(key) {
        const itemStr = localStorage.getItem(key)
        // if the item doesn't exist, return null
        if (!itemStr) {
          return null
        }
        const item = JSON.parse(itemStr)
        const now = new Date()
        // compare the expiry time of the item with the current time
        if (now.getTime() > item.expiry) {
          // If the item is expired, delete the item from storage
          // and return null
          localStorage.removeItem(key)
          return null
        }
        return item.value
      }

      window.idleTimer = setInterval(() => {
        if (typeof passphrase !== 'undefined' && passphrase.length < 512) {
          setWithExpiry('offline-viewer-pass', passphrase, 5 * 60 * 1000)
        }
      }, 30 * 1000);
      window.idleTimer = setInterval(() => {
        for (const [dir, cache] of Object.entries(medcrypt.dirCache)) {
            setWithExpiry('offline-viewer-dirs-'+dir, cache, 7 * 24 * 60 * 60 * 1000);
        }
      }, 5 * 1000);

