                  if (gifduration < defaultDuration) {
                    let gifDivisible = Math.ceil(defaultDuration / gifduration);
                    targetDuration = gifduration * gifDivisible;
                  }

                  slideshowTimer = setTimeout(function() {
                    $.fancybox.getInstance().next()
                  }, targetDuration);
                });
              return;
            }

            $("video").trigger("pause");
            var videoDuration = $("video").attr('duration');

            var updateProgressBar = function(){
                if ($("video").attr('readyState')) {
                    var buffered = $("video").attr("buffered").end(0);
                    var percent = 100 * buffered / videoDuration;

                    medcrypt.transfers.loaded = percent;
                    medcrypt.transfers.size = 100;
                    medcrypt.displayProgress();
                    if (percent > 10) {
                      $("video")
                        .trigger("play")
                    }
                    if (buffered >= videoDuration) {
                            clearInterval(this.watchBuffer);
                            medcrypt.finishProgress();
                    }
                }
            };
            var watchBuffer = setInterval(updateProgressBar, 500);
            if (usingRapiServe) {
              $('.gallerypicture[href="' + slide.src + '"]')
                  .attr("href", slide.src);
                $("video")
                  .find("Source:first")
                  .attr("src", slide.src)
                  .parent()
                  .trigger("load")
                  .trigger("play")
            } else {
              medcrypt.getSrc(slide.src, (uri) => {
                $('.gallerypicture[href="' + slide.src + '"]')
                  .attr("href", uri);
                $("video")
                  .find("Source:first")
                  .attr("src", uri)
                  .parent()
                  .trigger("load")
                  .trigger("play")
              });
            }
            $("video")
              .removeAttr("controls");
            $("video")
              .click(function toggleControls() {
                if (this.hasAttribute("controls")) {
                  this.removeAttribute("controls")
                } else {
                  this.setAttribute("controls", "controls")
                }
              });

            if ($.fancybox.getInstance().SlideShow.isActive) {
              $.fancybox.getInstance().SlideShow.stop();
              slideshowStarted = true;
            }

            if (!slideshowStarted) {
              return;
            }

            if (slideshowTimer) {
              clearTimeout(slideshowTimer);
            }

            let defaultDuration = 5000;
            let gifduration = jQuery(slide.$thumb).data('duration');
            gifduration = (!gifduration || typeof gifduration === 'undefined' || gifduration == 0) ? defaultDuration : gifduration;
            if (slide.$content && jQuery(slide.$content).find('video').length > 0) {
              jQuery(slide.$content).find('video').trigger('play');
              jQuery(slide.$content).find('video').on('ended', function() {
                $.fancybox.getInstance().next();
              });
              return;
            }

            let targetDuration = gifduration;
            if (gifduration < defaultDuration) {
              let gifDivisible = Math.ceil(defaultDuration / gifduration);
              targetDuration = gifduration * gifDivisible;
            }

            slideshowTimer = setTimeout(function() {
              $.fancybox.getInstance().next()
            }, targetDuration);
          });

          let scrollMemory = {};
          $("#backBtn").click(function() {
            let hash = window.location.hash.slice(1);
            if (hash) {
              let hashParts = hash.split(delim);
              let path = atob(hashParts[0]);
              if (path.split('---').length > 1) {
                pathParts = path.split('---');
                window.location.hash = "#" + [btoa(pathParts.slice(0, pathParts.length - 1).join('---')), ...hashParts.slice(1)].join(delim);
              } else {
                window.location.hash = "";
              }
            }
          });

          let lastHash = window.location.hash;
          if (!lastHash) {
            lastHash = "none";
          }

          $(window).on('hashchange', function(e) {
            medcrypt.flushQueue();
            let newhash = window.location.hash;
            if (!newhash) {
              newhash = "none";
            }
            let scrollTop = window.pageYOffset || document.documentElement.scrollTop;
            scrollMemory[lastHash] = scrollTop;
            document.documentElement.scrollTop = document.body.scrollTop = scrollMemory[newhash] ?? 0;
            lastHash = newhash;
            run();
          });
          run();
        })();
      }

      function processLazyLoad() {
        var lazyImages = [].slice.call(document.querySelectorAll("img.lazy"));
        if ("IntersectionObserver" in window) {
          let lazyImageObserver = new IntersectionObserver(function(entries, observer) {
            entries.forEach(function(entry) {
              let lazyImage = entry.target;
              if (entry.isIntersecting && lazyImage.dataset.src != "") {
                medcrypt.getSrc(lazyImage.dataset.src, (uri) => {
                  lazyImage.src = uri;
                });
                lazyImage.classList.remove("lazy-waiting");
                lazyImage.classList.add("lazy-loaded");
              } else if(lazyImage.classList.contains("lazy-loaded") && lazyImage.src !== "data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP///yH5BAEAAAAALAAAAAABAAEAAAIBRAA7") {
                lazyImage.dataset.src = lazyImage.src;
                lazyImage.src = "data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP///yH5BAEAAAAALAAAAAABAAEAAAIBRAA7";
                lazyImage.classList.remove("lazy-loaded");
                lazyImage.classList.add("lazy-waiting");
              }
            });
          });
          lazyImages.forEach(function(lazyImage) {
            lazyImageObserver.observe(lazyImage);
          });
        }
      }
    </script>
  </body>
</html>
